  // Door anchor (computed from mask centroid)
  const door = { x:0.5, y:0.52, ready:false };

  function clamp(v,a,b){ return Math.min(b, Math.max(a,v)); }

  function resize(){
    const r = canvas.getBoundingClientRect();
    const dpr = Math.max(1, window.devicePixelRatio || 1);
    canvas.width = Math.floor(r.width * dpr);
    canvas.height = Math.floor(r.height * dpr);
    ctx.setTransform(dpr,0,0,dpr,0,0);
  }

  function pointerFromEvent(e){
    const r = frame.getBoundingClientRect();
    pointer.x = clamp((e.clientX - r.left)/r.width, 0, 1);
    pointer.y = clamp((e.clientY - r.top)/r.height, 0, 1);
    pointer.last = performance.now();
  }
  frame.addEventListener('pointermove', pointerFromEvent);
  frame.addEventListener('pointerdown', (e)=>{ pointer.down=true; pointerFromEvent(e); });
  window.addEventListener('pointerup', ()=>{ pointer.down=false; });
  window.addEventListener('pointercancel', ()=>{ pointer.down=false; });

  function computeDoorAndMask(){
    maskW = maskImg.naturalWidth;
    maskH = maskImg.naturalHeight;
    maskC.width = maskW; maskC.height = maskH;
    maskCtx.clearRect(0,0,maskW,maskH);
    maskCtx.drawImage(maskImg,0,0);
    const img = maskCtx.getImageData(0,0,maskW,maskH);
    maskData = img.data;

    // centroid
    let sx=0, sy=0, sw=0;
    const step = 2;
    for (let y=0;y<maskH;y+=step){
      for (let x=0;x<maskW;x+=step){
        const i=(y*maskW+x)*4;
        const a=maskData[i+3]/255;
        if (a>0.01){ sx+=x*a; sy+=y*a; sw+=a; }
      }
    }
    if (sw>1e-4){ door.x=(sx/sw)/maskW; door.y=(sy/sw)/maskH; }
    door.ready=true;

    // candidate spawn points (every 3px where alpha is present)
    spawnPts.length = 0;
    for (let y=0;y<maskH;y+=3){
      for (let x=0;x<maskW;x+=3){
        const i=(y*maskW+x)*4;
        const a=maskData[i+3]/255;
        if (a>0.05) spawnPts.push([x,y,a]);
      }
    }
  }

  // Spawn points (x,y,weight)
  const spawnPts = [];

  function pickSpawn(){
    for (let k=0;k<6;k++){
      const p = spawnPts[(Math.random()*spawnPts.length)|0];
      if (!p) break;
      if (Math.random() < p[2]) return { x:p[0]/maskW, y:p[1]/maskH };
    }
    return { x:door.x, y:door.y };
  }

  // Particles
  const MAX = 1100;
  const BIRTH_RATE = 160; // per second
  const particles = [];

  function addParticle(t){
    const sp = pickSpawn();
    const angle = (-Math.PI/2) + (Math.random()-0.5)*0.9; // mostly upward
    const speed = 0.08 + Math.random()*0.22;

    particles.push({
      x: sp.x, y: sp.y,
      vx: Math.cos(angle)*speed*0.45,
      vy: Math.sin(angle)*speed*0.45,
      life: 0,
      ttl: 1.2 + Math.random()*1.6,
      size: 0.9 + Math.random()*2.2,
      spin: (Math.random()-0.5)*2.0,
      hue: 42 + (Math.random()*18 - 9),
      bright: 0.6 + Math.random()*0.6,
    });
  }

  function drawBackgroundGlow(w,h,t,intensity){
    const doorPx = door.x*w;
    const doorPy = door.y*h;
    ctx.save();
    ctx.globalCompositeOperation = 'screen';
    const g = ctx.createRadialGradient(doorPx, doorPy, 0, doorPx, doorPy, Math.max(w,h)*0.55);
    g.addColorStop(0.0, `rgba(255,200,110,${0.07*intensity})`);
    g.addColorStop(0.3, `rgba(255,160,60,${0.03*intensity})`);
    g.addColorStop(1.0, `rgba(0,0,0,0)`);
    ctx.fillStyle = g;
    ctx.fillRect(0,0,w,h);
    ctx.restore();
  }

  let t0 = performance.now();
  function tick(now){
    const w = canvas.getBoundingClientRect().width;
    const h = canvas.getBoundingClientRect().height;
    const dt = Math.min(0.05, (now - (tick._last||now))/1000);
    tick._last = now;

    ctx.clearRect(0,0,w,h);
    if (!door.ready){ requestAnimationFrame(tick); return; }

    const t = (now - t0)/1000;

    const age = now - pointer.last;
    const interacting = pointer.down || age < 700;
    const pull = interacting ? 1.0 : 0.22;

    const tx = (pointer.x - door.x) * pull;
    const ty = (pointer.y - door.y) * pull;

    const stiffness = interacting ? 18 : 9;
    const damping = 10;

    swirl.vx += (tx - swirl.x) * stiffness * dt;
    swirl.vy += (ty - swirl.y) * stiffness * dt;
    swirl.vx *= Math.exp(-damping*dt);
    swirl.vy *= Math.exp(-damping*dt);
    swirl.x += swirl.vx * dt;
    swirl.y += swirl.vy * dt;

    const breathe = 0.85 + 0.15*Math.sin(t*0.8);
    const intensity = clamp(breathe + (interacting?0.18:0.0), 0.65, 1.15);

    // Spawn
    const want = BIRTH_RATE * dt * intensity;
    for (let i=0;i<want;i++){
      if (particles.length < MAX) addParticle(t);
    }

    drawBackgroundGlow(w,h,t,intensity);

    // Draw particles
    ctx.save();
    ctx.globalCompositeOperation = 'lighter';

    const doorPx = door.x*w;
    const doorPy = door.y*h;

    for (let i=particles.length-1;i>=0;i--){
      const p = particles[i];
      p.life += dt;
      const u = p.life / p.ttl;
      if (u >= 1){ particles.splice(i,1); continue; }

      let px = p.x*w, py = p.y*h;
      const dx = px - doorPx;
      const dy = py - doorPy;
      const dist = Math.sqrt(dx*dx + dy*dy) + 1e-3;
      const ndx = dx/dist, ndy = dy/dist;

      // Tangent (vortex)
      const tx2 = -ndy, ty2 = ndx;

      const spinDir = (swirl.x >= 0 ? 1 : -1);
      const swirlStrength =
        (0.12 + 0.22*Math.abs(swirl.x)) *
        (1.0 / (1.0 + dist/(0.42*Math.min(w,h))));

      // Buoyancy + forward spill
      const buoy = 0.06;
      const forward = 0.05;

      p.vx += (tx2 * swirlStrength * spinDir + swirl.x*0.08) * dt;
      p.vy += (ty2 * swirlStrength * spinDir + (-buoy + swirl.y*0.06) + forward*(dist/(0.8*Math.min(w,h)))) * dt;

      p.vx *= Math.exp(-1.6*dt);
      p.vy *= Math.exp(-1.6*dt);

      p.x += (p.vx * dt);
      p.y += (p.vy * dt);

      const fadeIn = Math.min(1, u*6);
      const fadeOut = 1 - Math.pow(u, 1.8);
      const a = 0.55 * p.bright * fadeIn * fadeOut * intensity;

      const size = p.size * (0.85 + 0.35*Math.sin(t*0.7 + p.spin));
      const x = p.x*w;
      const y = p.y*h;
      const r = size * (1.6 + 2.4*(1-u));

      const hue = p.hue;
      const g = ctx.createRadialGradient(x,y,0, x,y,r);
      g.addColorStop(0, `hsla(${hue},95%,70%,${a})`);
      g.addColorStop(0.35, `hsla(${hue},95%,60%,${a*0.55})`);
      g.addColorStop(1, `hsla(${hue},95%,50%,0)`);
      ctx.fillStyle = g;

      ctx.beginPath();
      ctx.arc(x,y,r,0,Math.PI*2);
      ctx.fill();
    }

    ctx.restore();

    // Dark edges inside frame
    ctx.save();
    ctx.globalCompositeOperation = 'multiply';
    const vg = ctx.createRadialGradient(w*0.5, h*0.55, Math.min(w,h)*0.20,
                                        w*0.5, h*0.55, Math.max(w,h)*0.92);
    vg.addColorStop(0, 'rgba(0,0,0,0)');
    vg.addColorStop(0.72,'rgba(0,0,0,0.32)');
    vg.addColorStop(1, 'rgba(0,0,0,0.90)');
    ctx.fillStyle = vg;
    ctx.fillRect(0,0,w,h);
    ctx.restore();

    requestAnimationFrame(tick);
  }

  maskImg.onload = () => {
    resize();
    computeDoorAndMask();
    requestAnimationFrame(tick);
  };

  const ro = new ResizeObserver(resize);
  ro.observe(canvas);
  window.addEventListener('resize', resize);
})();
</script>
</body>
</html>
